import React from "react";
import NoticeCard from "./cards/NoticeCard";

function Notice(props) {
  let data = props.notice[0];
  console.log(data);
  return (
    // <div>notice</div>
    <div>
      {
        (data.map = (d) => {
          <NoticeCard id={d.id} question={d.question} answer={d.answer} />;
        })
      }
    </div>
  );
}

export default Notice;
